import React, { useState } from 'react';
import ReactDOM from "react-dom";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import './index.css';
import Hello from "./pages/hello";
import Hello2 from "./pages/hello2";
import Contacts from "./pages/contacts";
import Clicker from "./pages/clicker";
import Counter from "./pages/counter";
import Home from "./pages/Home";
import Menu from "./pages/PizzaMenu";
import Register from "./pages/Register";
import Login from "./pages/Login";
import Profile from "./pages/Profile";
function App() {

  const [loggedInUser, setLoggedInUser] = useState(null);

  const handleLogin = (user) => {
      setLoggedInUser(user);
  };

  const handleLogout = () => {
      setLoggedInUser(null);
  };

  const handleLoginLink = () => {
    setLoggedInUser(null);
};


return (
<Router>

<div>
        <header>
          <center><h1>Pizzernia</h1></center>
          {!loggedInUser && <button onClick={handleLogout}>Login</button>}
        </header>
        <nav>
            <ul>
              <li><Link to="/">Home</Link></li>
              <li><Link to="/menu">Menu</Link></li>
              {!loggedInUser && <li><Link to="/register">Rejestracja</Link></li>}
              {loggedInUser && <li><Link to="/profile">MÃ³j Profil</Link></li>}
              {loggedInUser && <li><button onClick={handleLogout}>Wyloguj</button></li>}
              <li><Link to="/clicker">Clicker</Link></li>
              <li><Link to="/counter">Counter</Link></li>
            </ul>
          </nav>  

        <article>

            <Routes>
            <Route path="/" element={<Home/>}/>
            <Route path="/menu" element={<Menu/>}/>
            <Route path="/register" element={<Register />} />
            <Route path="/login" element={<Login onLogin={handleLogin} />} />
            <Route path="/profile" element={<Profile user={loggedInUser} />} />

            <Route path="/hello2" element={<Hello2 title="Jan" content="Hello!"/>}/>
            <Route path="/contacts" element={<Contacts/>}/>
            <Route path="/clicker" element={<Clicker/>}/>
            <Route path="/counter" element={<Counter/>}/>
            </Routes>


 </article>
 </div>
 </Router>
 ); }
ReactDOM.render(<App />, document.getElementById("root"));
